import React from "react";
import styles from "./GridContainer.module.css";

function GridContainer() {
  return (
    <div className={styles.container}>
      <div className={styles.item}>
        Lorem ipsum dolor sit amet, consectetur adipiscing elit. Sed eget
        hendrerit enim. Pellentesque habitant morbi tristique senectus et netus
        et malesuada fames ac turpis egestas. Vestibulum iaculis mi vitae lectus
        consequat, vitae mollis libero finibus. Curabitur posuere sapien lacus,
        quis condimentum lectus pretium at. In aliquet ac ante non accumsan.
      </div>
      <div className={styles.item}>B</div>
      <div className={styles.item}>C</div>
      <div className={styles.item}>D</div>
      <div className={styles.item}>E</div>
      <div className={styles.item}>F</div>
      <div className={styles.item}>G</div>
    </div>
  );
}

export default GridContainer;
